import {
  BellOutlined,
  CalendarOutlined,
  OrderedListOutlined,
  PieChartOutlined,
  UserOutlined,
} from "@ant-design/icons";
import { Card, Col, Drawer } from "antd";

export const SideBar = () => {
  return (
    <center>
      <div style={{ height: "300px", width: "500px" , marginTop:'20%'}}>
        <Card
          style={{
            width: "160px",
            height: "140px",
            border: "none",
            boxShadow:
              "rgba(0, 0, 0, 0.19) 0px 4px 10px, rgba(0, 0, 0, 0.23) 0px 3px 3px",
            background: "rgb(134, 154, 223)",
            opacity: "0.9",
            display: "flex",
            justifyContent: "center",
          }}
        >
          <Card
            style={{
              borderRadius:'11px 11px 25px 25px',
              position: "relative",
              width: "150px",
              height: "140px",
              border: "none",
              boxShadow:
                "rgba(0, 0, 0, 0.19) 0px 4px 10px, rgba(0, 0, 0, 0.23) 0px 3px 3px",
              background: "rgb(91, 91, 92)",
              opacity: "1",
              bottom: "0px",
            }}
          ></Card>
        </Card>
      </div>
    </center>
  );
};
